import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { useState } from 'react';

function PermHeader() {
  return <h1 className="PermHeader">Suduoku</h1>;
}

function Cell() {
  const [value, setValue] = useState('');

  const handleChange = (event) => {
    const inputValue = event.target.value;
    if (/^[1-9]?$/.test(inputValue)) {
      setValue(inputValue);
    }
  };

  return (
    <input
      type="text"
      value={value}
      onChange={handleChange}
      className="cell"
      maxLength="1"
      readOnly /* Prevents the flashing cursor */
      onClick={(e) => e.target.removeAttribute('readonly')} /* Enable editing on click */
      onBlur={(e) => e.target.setAttribute('readonly', true)} /* Disable editing on blur */
    />
  );
}


function ThreeGrid() {
  const threegrid = Array.from({ length: 3 }, (_, rowIndex) => (
    <div key={rowIndex} className="grid-row">
      {Array.from({ length: 3 }, (_, colIndex) => (
        <Cell key={colIndex} />
      ))}
    </div>
  ));

  return <div className="threeGrid">{threegrid}</div>;
}

function FinalGrid() {
  const finalGrid = Array.from({ length: 3 }, (_, rowIndex) => (
    <div key={rowIndex} className="grid-row">
      {Array.from({ length: 3 }, (_, colIndex) => (
        <ThreeGrid key={colIndex} />
      ))}
    </div>
  ));

  return <div className="finalGrid">{finalGrid}</div>;
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <PermHeader />
    <FinalGrid />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
